import styled from "styled-components";


export const BrandStoryBannerWrapper=  styled.div`
background-color: #0565bb;
width: 100%;
height: 956px;
`;
export const Header = styled.div`
  top:100px;
  left: 50%;
  transform: translate(-50%, -50%);
  margin: 0 29px 49px;
  font-family: Montserrat;
  font-size: 50px;
  font-weight: bold;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.2;
  letter-spacing: 5px;
  text-align: center;
  color: #f96400;
  position: absolute;
`;
